import React from "react";
import ArticlesContainer from "../components/ArticlesContainer";
import Aside from "../components/Aside";

class Main extends React.Component {
  render() {
    return (
      <div className="container-main">
        <div className="row">
          <div className="col-9">
            <ArticlesContainer />
          </div>
          <div className="col-3">
            <Aside />
          </div>
        </div>
      </div>
    );
  }
}

export default Main;
